"policy_shipping": "I ship the glassware well protected. I use priority mail to ship my product, for a 2-5 day delivery. Sometimes, I ship through my husbands office (because I have 2 two year olds and sometimes I am not able to make it to the post office during regular hours).\r\n\r\n If a piece were to break during shipping, I will have insurance on each package up to $50 so if it is lost or broken I will be able to send out a replacement. I just ask that you take a picture of the box and product and let me know within 48 hours.\r\n\r\n** Also you MUST keep the broken glassware and all packaging until the claim is settled.  I know it is not ideal, but the post is requiring this in some cases, and the claim will not be paid if is not in hand to view.\r\n\r\nIf you do not comply with the procedures required by the post office you are responsible for the amount of the replacement pieces. I go on good faith sending a replacement before the claim is paid out. The post office as we all know takes a bit of time to get things like this handled, so I do not want you to wait for your glassware. \r\n\r\nWe do ship internationally, but those packages do not include any taxes on the buyers end. It also does not include tracking. \r\n\r\nLet me know if you have any questions or concerns about this policy and I would be happy to go into detail. It sounds so much worse than it is, but I like to be clear on the worst case scenario :)\r\n\r\nI use Priority mail through USPS, and will arrive to you in 3-5 days. ",
