"announcement": "**QUICK TURN AROUND TIME with every flask purchased. Most orders will be processed and shipped within 3 to 5  BUSINESS Days***\r\n\r\nWedding flasks, hip flasks, whiskey flasks, personalized in my studio and wood shop near Vancouver, Washington. Come on in and browse and let me know if you have questions, I specialize in personal service! ",
