"description": "Hand poured small batch pure soy candle. Who ordered the fireball shots because that exactly how this candle is scented, strong whiskey with a hint of cinnamon. \n8 oz square mason jar with rustic bronze lid\n\n\nWe pour the best soy wax product available today. It&#39;s 100% vegetable, made with pure, all-natural soybean oil using soy beans that are farm-grown in the U.S. This wax is completely free of paraffin product, which is derived from refined crude oil. \nWe use a flat, coreless cotton wick that is braided with thin paper filaments. These filaments aid in reducing soot and mushrooming at the end of the wick during burning. Each wick is primed with soy wax as well, not paraffin, for a clean burn.\nWe use only premium-grade fragrance oils. \n\nSoy Candle Info:\n-all natural pure soy wax\n-infused with pure essential oils and premium phthalate free fragrances\n-re-usable 8 oz mason jar 3.5&quot; Height 3&quot; Diameter\n-burns cleanly and slowly\n-50-60 hour burn time\n-cotton wicked\n-100% dye free\n-lead free\n\n**Burning Instructions**\nTrim wick to 1/4&quot; before lighting\nKeep burn pool free of foreign objects\nLet wax melt completely to edge before extinguishing. This will discourage tunneling giving the candle the longest life possible.\nDo not burn for more than 4 hours at a time\n\nClean burning, soy candles do not emit toxins or chemicals and are less likely to trigger allergies. Naturally biodegradable and water-soluble, soy wax spills are easy to clean up and do not leave a chemical film on the candle jar. \n\nPhalate free",
