"policy_welcome": "WELCOME to my shop!  We are proud to offer custom gifts that are perfect for Wedding gifts, Graduation presents or Just a HAPPY for yourself.  We pride ourselves in our craftsmanship and the quality product we provide.  Our gifts are unique and remain a favorite for new brides.  Please make sure to provide our shop with feedback so that we can determine how to better serve the needs of our customers.",
"policy_payment": "We accept both direct checkout and paypal.",
"policy_shipping": "We typically ship within 2 to 3 weeks once we receive your payment and personalization information (does not include weekends and holidays).  Large orders make take longer and we will communicate that to you in writing before we set the custom order up.  We ship using USPS and UPS depending on the fairest shipping price for your order.  We can offer insurance at additional cost.  Please let me know if you wish to have your order insured when you place your order.  We will always offer shipping confirmation no matter who we use for shipping.  This provides everyone with great information about where their order is.  If for some reason your order is lost in transit, we will work on our end to try to find the package and/or replace your order.",
"policy_refunds": "Since your order is a custom product, unless there is damage in shipping that is confirmed though pictures and communicated immediately upon receipt or if we inadvertently mix your initials up, we do not offer returns or refunds.  Please make sure you offer us the correct spelling and/or initials in your order.  I will sometimes double check with you the order of the initials or the spelling so that we all are aware of what you are getting.\r\n\r\nETSY is responsible for all credit card / paypal processing.  I do not ever see your personal credit card or paypal information.  Refunds/Cancellations are initiated by my shop if needed, but ETSY is responsible for your refund.  \r\n\r\nThis is ETSY&#39;s policy on refunded money:\r\nDepending on your credit card provider or bank, it may take 3-5 business days for a refund to be reflected on your statement. Occasionally, refunds issued to non-US credit cards can take up to 30 days to be reflected.\r\n\r\nYou may want to contact your bank or credit card provider for more detailed information.\r\n\r\nTo review an order&#39;s refund history, click Your Account &gt; Purchases and then View Receipt next to the transaction. ",
"policy_additional": "Please remember that we are a custom-made product shop and that all orders are done once we receive all personalization information from you.  Please note that we can offer drop-shipping to a customer.  Please convo me to let me know that you are needing this service added to your order.\r\n\r\nWe ask that all correspondence take place via etsy conversations.  We process several orders a day and written documentation is the best and only way for us to ensure that we have all of the necessary, correct information needed to personalize your order.  We always refer to any convos when making your order to see if there are any changes, address corrections or time-line constraints.  Telephone conversations are not encouraged.  Although they may seem convenient, they are not our policy.\r\n\r\nWe reserved the right to cancel any order that is a request for us to copy another etsy  designers product in design or do a copyright logo.  We strive to offer unique gifts and respect the work of our fellow etsyians and all copyright logos.  Any requests for this type of work will be cancelled and any convos will be redirected to our shop policy.",
