"title": "Personalized Groomsman & Bridesmaid Gifts,Wedding Gifts",
"announcement": "Personalized Monogrammed Bridal Gifts.  Bride, Bridesmaid, Groom, Groomsmen, Mother & Father of  the Bride and Groom, Junior Bridesmaid, Flower Girl and Ring Bearer Gifts - Wine Glasses, Champagne Flutes, Tumblers, Beer Mugs, Shot Glasses, Pint Glasses, Mason Jars, Acrylicware and Photo Prop Wood.  ~~~Current production time is 2 weeks~~~\r\n\r\nSPECIAL GIFTS FOR YOUR SPECIAL DAY\r\n\r\nI&#39;m happy to announce that my husband Brent has taken the etched glass and wood projects on.  So if you see any convo&#39;s from him, he&#39;s the man in charge on those areas.\r\n\r\n~~~~~~~~~~~~~~~~~~~~~~\r\nORDERING AND SHIPPING\r\n~~~~~~~~~~~~~~~~~~~~~~\r\n\r\nAll items in my shop are made to order items & not readily available for shipping.  Our production time frame is typically 2 to 3 weeks.  Etched Glassware is a 3 week production time.  Then orders are shipped, usually via USPS mail or UPS.  Each glass is individually padded and boxed to help reduce breakage, then those boxes are shipped together in a larger box .  We try our best to ensure your package arrives safe and sound.  \r\n\r\nWe are always able to do a custom order for any amount of glass you need or any combination of glasses you might want.  No order is too small or too large.  I do give a discount for 20+ glass orders.  Just convo me what you need and I will set you up a custom listing for the discounted price.\r\n\r\nIf I have any questions regarding your order, I will email you to clarify what the order issues are.  If you note any incorrect information in either your convo to me or in the note to seller, please contact me immediately.  Some days we can get orders out more quickly than others depending on order volume.  We will produce your custom order to your exact specifications.  No refunds will be offered for misspelling received by our shop.  All orders will have an invoice shipped with them with your NOTE TO SELLER for your personalization reference.  \r\n\r\nNew to etsy?  Here&#39;s a link to help you make your first purchase:\r\nhttp://www.etsy.com/help/article/339/\r\n\r\n\r\n\r\n~~~~~~\r\nCONVO\r\n~~~~~~\r\nFeel free to convo me at any time.  I generally answer within 12-24 hours. I am a WAHM with a 3 year old, so  If you have not heard from me within the 24 hr time frame, please convo me again (sometimes they get lost in space).  I try to spend my weekends with my family so any convos received over the weekend will be answered on Monday.  We are always open to your ideas and will always try to work with you on any special requests that you have. \r\n\r\n~~~~~~~~~\r\nFEEDBACK\r\n~~~~~~~~~\r\nI am a buyer on etsy myself and I know the power of feedback.  Please let us know what type of experience you&#39;ve had with us.  We strive to do our best and sometimes we make errors, but I will always try my best to correct them as quickly as possible.  \r\n\r\n\r\n\r\n\r\nhttp://www.etsy.com/help/article/102/\r\nThanks for taking a look at us and HAPPY SHOPPING!\r\nAlisha",
