"description": "BUY 2 PRINTS AND GET 1 FREE\n► DO NOT PURCHASE YOUR FREE PRINT! Simply write the full name (or paste the link) of the print you would like for free in the &quot;Message to Seller box&quot; during checkout.\n► Free item must be the same price or less than the purchased items.\n► This discount is also stackable--in other words, if you buy 4 prints, you get 2 extra prints for FREE, and purchasing 6 prints gets you 3 for FREE.\n► Also, there is NO EXTRA SHIPPING FEE for prints purchased in the same order. \n______________________________________\nSIMILAR DICTIONARY ART PRINTS IN MY SHOP\n► More CIGAR dictionary art prints here: https://www.etsy.com/shop/Lexiconograph/search?search_query=cigar&order=date_desc&view_type=list&ref=shop_search\n► ALCOHOL and BAR ART dictionary art prints here: https://www.etsy.com/shop/Lexiconograph/search?search_query=ALCOHOL&order=date_desc&view_type=list&ref=shop_search\n► Dictionary art prints FOR FOODIES here: https://www.etsy.com/shop/Lexiconograph?section_id=15099883\n______________________________________\nABOUT MY DICTIONARY ART\n► The pages are &quot;upcycled&quot; from old dictionaries (and sometimes other books) that otherwise would be destroyed. \n► The pages, which are delicately yellowed with age, are carefully removed from the dictionary and trimmed to size. Because each page is unique, your work of art will be one-of-a-kind.\n► The images are carefully designed and crafted and then printed on the old dictionary pages using a high-end printer (Epson 2200). \n► I am constantly testing to make sure that the colors, tone, and brightness of the images are correctly balanced against the print on the dictionary page► These unique prints complement almost any decor -- vintage, modern, apartment or college dorm -- and any room -- office, bedroom, bath, living room, hallway....\n______________________________________\nPRINT SIZE\n► Frames and mats are not included. However, the size of the dictionary pages I use are roughly 11&quot; by 8&quot;-8.25&quot;. This will fit in a mat sized for 8x10&quot; prints (which typically have openings of 7.5 x 9.5&quot;).\n______________________________________\nSHIPPING\n► Prints will be mailed in durable cardboard envelopes, stamped &quot;DO NOT BEND&quot; in red ink.\n► Prints will be shipped via USPS First Class in 2-3 business days, although I try to ship within 24 hours. They typically arrive in 2-3 days. If you want overnight shipping, let me know and I can create a custom order with which you can pay the extra amount.\n► International orders are shipped USPS First Class International. Depending on the customs protocols used in your country, arrival could take anywhere from 7 to 30 days. In order to keep my shipping costs reasonable, I do not provide tracking.\n______________________________________\nWHAT TO EXPECT\n► MY SHOP IS ALL ABOUT PROFESSIONALISM, PROMPT DELIVERY, AND CUSTOMER SATISFACTION. IN MOST CASES, YOUR ITEM WILL BE SHIPPED WITHIN 24 HOURS.\n► See my 5-star reviews here: https://www.etsy.com/your/shops/Lexiconograph/reviews?ref=shop_info\n► Visit my Etsy shop here: https://www.etsy.com/shop/Lexiconograph\n______________________________________\nMONEY-BACK GUARANTEE\n► Each print is created to exacting standards. If you are in any way unsatisfied with the print, let me know, and if we can&#39;t work out any other solution, I&#39;ll be happy to offer you a FULL REFUND upon return of the original. \n______________________________________\nFRAMING IDEAS FOR PRINTS ON PHOTO PAPER\n► Frames for 8X10 prints, with and without mats, are widely available at stores such as Ikea, Target, Walmart, and Amazon.\n► If you really want to choose from a huge selection of frames and mats, go to pictureframes.com.",
