"announcement": "Lexiconograph offers dictionary art prints of images related to:\r\n► Lifestyle: kitchen decor, food and wine, alcohol, whiskey, cigars, etc.\r\n► Travel: Colorado, Italy, France, England, US cities, etc.\r\n► Sports: baseball, football, hockey, etc.\r\n► Art, Movies and Literature: Wes Anderson, Charlotte&#39;s Web, Lord of the Rings, Grand Budapest Hotel, Painted Elephants, etc.\r\n\r\nAll items are printed on vintage pages from old &quot;upcycled&quot; dictionaries.\r\n\r\n--Purchase 2, get 1 more for FREE....\r\n--Purchase 4, get 2 more for FREE....\r\n--Purchase 6, get 3 more for FREE....And the shipping fee remains the same.....\r\n--Purchase 8, get 4 more for FREE.....\r\n--And so on....\r\nImportant: DO NOT PUT YOUR FREE PRINTS IN YOUR CART. When checking out, just copy the title of (or the link to) the extra prints into the box marked &quot;Notes to Lexiconograph.&quot; \r\nAlso, there is no extra shipping fee for prints purchased in the same order.",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Great thanks for your purchase!\r\n\r\nI make every effort to print and ship orders within 24 hours, though occasionally events conspire against my best wishes--though usually not for more than just a couple days.\r\n\r\nI&#39;ll contact you again to let you know when the order is being shipped.\r\n\r\nIf you live outside the US, extra patience may be required. Customs officials at the border seem to follow their own timelines, and they may hold things up for reasons of their own. But so far, every one of the thousands of orders I&#39;ve fulfilled have arrived in good shape.\r\n\r\nThanks,\r\nRobert",
"digital_sale_message": null,
