"policy_welcome": null,
"policy_payment": "I accept Paypal and Etsy&#39;s direct checkout payments, where you can use either credit cards or gift certificates. I do not currently accept any other payment method. ",
"policy_shipping": "I enclose the prints in moisture-proof plastic sleeves and package them in durable cardboard mailers stamped with &quot;Do Not Bend&quot; warnings. Prints ship within 1-3 business days of your order, but in most cases, I am able to ship the next day. If you want overnight shipping, let me know and I can create a custom order through which you can pay the extra amount.\r\n\r\nThere is no extra shipping fee for multiple prints in one order.\r\n\r\nUS Customers: All items are generally shipped via USPS First Class Mail. I&#39;ve rarely experienced any problems with USPS, though on rare occasions they can be slow. Please allow the them up to 2 weeks for domestic delivery before requesting a refund for nondelivery.\r\n\r\nInternational Customers: All items are generally shipped via USPS First Class International Package Services. I do everything possible on my end to ensure a flawless delivery, but please note that international transit and individual countries customs procedures can sometimes delay your packages. Please allow up to 6 weeks for international delivery before requesting a refund for nondelivery.",
"policy_refunds": "All prints are 100% returnable for the full purchase price. Your satisfaction is guaranteed! I will not issue a refund on &quot;missing&quot; prints or nondelivered prints until at least two weeks (14 days) have passed. ",
"policy_additional": "BUY 2 PRINTS AND GET 1 FREE\r\n► DO NOT PURCHASE YOUR FREE PRINT! Simply write the full name of the print (or paste its link) would like free in the &quot;Message to Seller box&quot; during checkout.\r\n► This discount is also stackable--in other words, if you buy 4 prints, you get 2 extra prints for FREE, and purchasing 6 prints gets you 3 for FREE.\r\n► Also, there is NO EXTRA SHIPPING FEE for prints purchased in the same order. ",
